import { useEffect, useState } from 'react';
import './App.css';

function App() {

  const [city, setCity] = useState([])

  useEffect(()=>{
    fetch('https://api.weatherbit.io/v2.0/current?lat=35.7721&lon=-78.63861&key=097dd5fffd324ebb875e47ef3fed2fa1	')
      .then(data => data.json())
      .then(data => setCity(data.data))
  },[])

  console.log(city)

  return (
    <div className="App">
      {city && <p>{city[0].api}</p>}
    </div>
  );
}

export default App;
